import { render } from "@testing-library/react";
import React from "react";



class Notice extends React.Component {
    render() {
        return (
            <div className="notice-user"  >
                <div className="notice-title"><p>Thông báo</p></div>
                <div className="notice-list" id="style-1" >

                    <div className="notice-item">
                        <p className="notice-name-user">nguyen duy duc</p>
                        <p className="notice-content-user">ngày 30 thang 4 nam 2000</p>
                    </div>


                </div>
            </div>
        );
    }
}
export default Notice;
